    <script type="text/javascript">
        $('#password, #confirm_password').on('keyup', function () {
            var status ="";
      document.getElementById("validation-lower").style.color  = 'red';
      document.getElementById("validation-upper").style.color  = 'red';
      document.getElementById("validation-digit").style.color  = 'red';
      document.getElementById("validation-length").style.color  = 'red';
      document.getElementById("validation-special").style.color  = 'red';
      var upperCaseLetters = /[A-Z]/g;
  if($('#password').val().match(upperCaseLetters)) {
    document.getElementById("validation-upper").style.color  = 'green';
    status= status + "1";
  }
  var numbers = /[0-9]/g;
  if($('#password').val().match(numbers)) {
    document.getElementById("validation-digit").style.color  = 'green';
    status= status + "1";
  }
  if($('#password').val().length >= 6) {
    document.getElementById("validation-length").style.color  = 'green';
    status= status + "1";
  }
  var lowerCaseLetters = /[a-z]/g;
  if($('#password').val().match(lowerCaseLetters)) {
    document.getElementById("validation-lower").style.color  = 'green';
    status= status + "1";
  }
  var special =  /[@$!%*#?&_]/g;
  if($('#password').val().match(special)) {
    document.getElementById("validation-special").style.color  = 'green';
    status= status + "1";
  }

    if ($('#password').val() == $('#confirm_password').val()) {
      $('#message').html('Matching').css('color', 'green');
      status= status + "1";
    } else{
      $('#message').html('Not Matching').css('color', 'red');
    }
console.log(status == 111111);
    if (status == 111111) {
            document.getElementById('password-submit').removeAttribute('disabled','');
        }
        else{
            document.getElementById('password-submit').setAttribute('disabled','');

        }
} );



    </script>

    <script type="text/javascript">
        $(".wbd-form").submit(function (e) {

      e.preventDefault();

      swal.fire({
        title: "Are you sure?",
        text: "This will process your request.",
        type: 'warning',
        showCancelButton: true,
        confirmButtonText: "Yes, Process it!",
        cancelButtonText: "No, Keep it!",
        }).then((result) => {
          if (result.value) {
            $(this).closest(".wbd-form").off("submit").submit();
          }else{
            swal.fire("Cancelled","Your request is safe!",'error')
          }
      });

    });

    </script>

